import { useState, useEffect, useCallback } from 'react';
import {
    Autocomplete,
    Avatar,
    TableCell,
    TableRow,
    Grid,
    Dialog,
    DialogTitle,
    DialogActions,
    DialogContent,
    Typography,
    Button,

    } from '@mui/material';
function Modals (Data) {
    const [opent, setOpent] = useState(false);
    const bitacora= () => {
        setOpent(true);
      };
      const bitacoraClose = () => {
        setOpent(false);
      };
    const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: 400,
        bgcolor: 'background.paper',
        border: '2px solid #000',
        boxShadow: 24,
        p: 4,
      };
    return(
        <>
            <div>
                <Button onClick={bitacora}  variant="contained"><span className='check'>></span>Continuar</Button>
            <Dialog
            maxWidth="md"
            open={opent}
            onClose={bitacoraClose}
            >
            <DialogTitle
            sx={{
            p: 3
            }}
            >
            <Typography variant="h4" gutterBottom>
            <label>Nombre Usuario</label><b>{Data.Data.nombre}</b>
            </Typography>
            </DialogTitle>
            <form>
            <DialogContent>
            <Grid item xs={12} md={12}>
            <tbody>
            <TableCell>{('#')}</TableCell>
            <TableCell>{('Usuario')}</TableCell>
            <TableCell>{('Fecha')}</TableCell>
            <TableCell>{('Comentario')}</TableCell>
            {Data.Data.map(data => {
            return (
            <TableRow key={data}>
            <TableCell>{data.solinume}</TableCell>
            <TableCell>{data.usuaalia}</TableCell>
            <TableCell>{data.sobifech}</TableCell>
            <div dangerouslySetInnerHTML={{__html: data.sobitext}} className='container'/>
            </TableRow>
            )})}   
            </tbody>
            </Grid>
            </DialogContent>
            <DialogActions
            sx={{
            p: 3
            }}
            >

            </DialogActions>
            </form>
            </Dialog>
        </div>
        </>
    )
}
export default Modals;
